import {Container} from 'react-bootstrap';
import Link from "next/link";
import React from "react";

const Footer = () => (
    <footer>
        <style jsx>{`
            .container{
                margin:0px 0px;
            } 
            .list-group-item{
                background: transparent;
                padding: .35rem 1.25rem;
                border: none;
            }
            .list-group-item::before{
                font-family: "Font Awesome 5 Free";
                 font-weight: 900; 
                 content: "\\f105"; 
            }
             .icon::before {
    display: inline-block;
    font-style: normal;
    font-variant: normal;
    text-rendering: auto;
    -webkit-font-smoothing: antialiased;
  }

  .login::before {
    font-family: "Font Awesome 5 Free"; font-weight: 900; content: "\\f007";
  }

  .tps::before {
    font-family: "Font Awesome 5 Free"; font-weight: 400; content: "\\f1ea";
  }

  .twitter::before {
    font-family: "Font Awesome 5 Brands"; content: "\\f099";
  }
        `}</style>
        <Container>
            <div className="container">
                <div className="row">
                    <div className="col-sm-6 col-md-3">

                        <ul  >
                            <li><span className="icon login"></span> Login</li>
                            <li><span className="icon tps"></span> TPS Reports</li>
                            <li><span className="icon twitter"></span> Twitter</li>
                        </ul>
                    </div>
                    <div className="col-sm-6 col-md-3">
                        <h3>Contact gegevens</h3>
                        <ul className="list-group list-group-flush">
                            <li className="list-group-item">Cras justo odio</li>
                            <li className="list-group-item">Dapibus ac facilisis in</li>
                            <li className="list-group-item">Morbi leo risus</li>
                            <li className="list-group-item">Porta ac consectetur ac</li>
                            <li className="list-group-item">Vestibulum at eros</li>
                        </ul>
                    </div>
                    <div className="col-sm-6 col-md-3">
                        <h3>Diensten</h3>
                        <ul className="list-group list-group-flush">
                            <li className="list-group-item">Cras justo odio</li>
                            <li className="list-group-item">Dapibus ac facilisis in</li>
                            <li className="list-group-item">Morbi leo risus</li>
                            <li className="list-group-item">Porta ac consectetur ac</li>
                            <li className="list-group-item">Vestibulum at eros</li>
                        </ul>
                    </div>
                    <div className="col-sm-6 col-md-3">
                        <h3>Over ons</h3>
                        <p>
                            Mediaverse is een strategisch webbureau voor bedrijven in regio Uden, Den Bosch en Eindhoven. Als strategen denken wij verder. Met alles onder één dak behaalt u maximaal resultaat op het internet.
                        </p>
                    </div>
                    <div className="col-xs-12">
                        <Link href='/'><a>Home</a></Link> |
                        <Link href='/about'><a>About</a></Link> |
                        <Link href='/contact'><a>Contact</a></Link>
                    </div>
                </div>
            </div>
        </Container>
    </footer>
)

export default Footer
